import { Component, OnInit, Input } from '@angular/core';
import { TransactionsInterface, TransactionsService } from '../../../transactions/services/transactions.service';
import * as jsPDF from 'jspdf'

@Component({
  selector: 'app-vote-type',
  templateUrl: './vote-type.component.html',
  styleUrls: ['./vote-type.component.css']
})
export class VoteTypeComponent implements OnInit {

  hash: string;
  signer: string;
  signature: any;
  string: string;
  end: number;
  start: number;
  @Input() transactionInfo: TransactionsInterface;
  searching = true;
  typeTransactionHex: string;

  constructor(
    public transactionService: TransactionsService
  ) { }

  ngOnInit() {
    // console.log('MODAL INFO', this.transactionInfo);
    this.start = 0;
    this.end = 46;

    this.signature = this.cutChain(this.transactionInfo.data.signature, this.start, this.end);
    this.signer = this.cutChain(this.transactionInfo.data.signer.publicKey, this.start, this.end);
    this.hash = this.cutChain(this.transactionInfo.hash, this.start, this.end);
  }

  cutChain(variable, start, end) {
    let string = '';
    while (variable.length > string.length) {
      if (string === '') {
        string += variable.substr(start, end);
      } else {
        string += `\n` + variable.substr(string.length, end);
      }
    }
    return string;
  }

  pdfCertificate() {
    // console.log('INFO PARA EL PDF', this.transactionInfo);
    var imgData = "data:image/png;base64,";

    var doc = new jsPDF({
      orientation: 'landscape',
      unit: 'in',
      format: [658, 300]
    })

    doc.addImage(imgData, 'JPEG', 0, 0, 0, 0)
    doc.setFontSize(8)
    doc.text(this.transactionInfo.timestamp, 0.26, 1.45)
    doc.setFontSize(12)
    doc.text(this.transactionInfo.fee, 1, 1.85)
    doc.text(this.transactionInfo.name, 1, 2.47)
    doc.setFontSize(10)
    doc.text(this.transactionInfo.recipient.pretty(), 1, 3.04)

    doc.setFontSize(9)
    doc.text(this.signer, 5.47, 2.2)
    doc.text(this.signature, 5.47, 2.93)
    doc.text(this.hash, 5.47, 3.8)
    doc.save('voting_certificate.pdf');

  }
}
